import React, { Component } from 'react'
import Signup from './Signup'

export class HomePage extends Component {
    handleClick = () => {
        return <Signup />
    }
    render() {
        return (
            <div>
                <button onClick={this.handleClick}>signup</button>
                <Signup />
            </div>
        )
    }
}

export default HomePage
